  true,\n\t\"url\": null,\n\t\"notes\": \"<p>The Tarrant County Public Health (TCPH)
  and Biosense collaboration is an effort to visualize TCPH health data collected
  by Biosense using Google Fusion Table technology and make that visualization publicly
  available. The data consists of patient visits to hospital emergency departments
  associated with Tarrant County Public Health (TCPH)  that had the illness Gastro
  Intestinal, Heat Related, or Upper Respiratory divided by all emergency department
  visits that occurred for the same time period and in the geographic granularity
  for which the calculation was made.</p>n\",\n\t\"owner_org\": \"3609164c-4c49-4a44-9179-23163027dc0a\",\n\t\"extras\":
